CREATE TABLE "facilities" (
	"ID"	INTEGER PRIMARY KEY AUTOINCREMENT,
	"FacilityNumber"	TEXT NOT NULL,
	"FacilityName"	TEXT NOT NULL,
	"CommonName"	TEXT,
	"Zone"	TEXT,
	"Region"	TEXT,
	"District"	TEXT,
	"Council"	TEXT,
	"Ward"	TEXT,
	"VillageStreet"	TEXT,
	"FacilityType"	TEXT,
	"OperatingStatus"	TEXT,
	"Latitude"	NUMERIC,
	"Longitude"	NUMERIC,
	"Location"	TEXT NOT NULL,
	UNIQUE("FacilityNumber","Location")
);



